-- ----------------------------
-- Procedure structure for `GetModuleTableName`
-- ----------------------------
DROP PROCEDURE IF EXISTS `GetModuleTableName`;
DELIMITER ;;
CREATE DEFINER=`seruser`@`%` PROCEDURE `GetModuleTableName`(IN v_CurTime varchar(32))
    SQL SECURITY INVOKER
lable_1:
begin    
	declare v_NewTableName VARCHAR(64);     
	declare v_CurTableName VARCHAR(64);  
	declare v_InitialTableName VARCHAR(64);  
	declare v_NewTable int default 0;

	declare exit handler for sqlexception
	begin        
		set v_CurTableName="";
		select v_CurTableName as CurTableName, @v_MaxID as MaxID;
		rollback;
	end;
	
	set v_InitialTableName="oprecord";
	set @v_MaxID=0;

start transaction; 
	set v_NewTableName=concat(v_InitialTableName, "_",v_CurTime);
	set v_CurTableName="";

	select CurTableName into v_CurTableName from moduletablename order by ID desc limit 1;
	-- 未创建表，则创建
	if (v_CurTableName="")  then 
		begin
			set v_NewTable=1;
		end;	
	else
		begin
			SET @v_Sql = concat("select count(*) into @v_TotalNum from ", v_CurTableName);
			prepare stml from @v_Sql;
			EXECUTE stml;
			if (@v_TotalNum > 10000000) then 
				begin
					set v_NewTable=1;					
				end;	
			end if;			
		end;
	
	end if;
	
	if (v_NewTable=1) then 
		begin
			SET @v_Sql = concat("CREATE TABLE ",
				v_NewTableName,
				"(`ID` int(10) unsigned NOT NULL,",
				"PlayerID int(10) unsigned NOT NULL,",
				"ModuleType smallint(5) unsigned NOT NULL,",
				"OpType smallint(5) unsigned NOT NULL,",
				"OpValue int(10) unsigned NOT NULL,",
				"OpTime datetime NOT NULL,",				
				"AfterOpValue bigint(20) unsigned NOT NULL,",
				"Param1 bigint(20) unsigned NOT NULL,",
				"Param2 bigint(20) unsigned NOT NULL,",
				"Param3 bigint(20) unsigned NOT NULL,",
				"Param4 bigint(20) unsigned NOT NULL,",
				"PlayerLevel smallint(5) unsigned NOT NULL,",
				"VipLevel smallint(6) NOT NULL,",
				"Comment varchar(128) NOT NULL DEFAULT '',",
				"PRIMARY KEY (`ID`),",
				"KEY IX1 (ModuleType, OpType, OpTime),",
				"KEY IX2 (PlayerID, ModuleType, OpTime),",
				"KEY IX3 (PlayerID, ModuleType, OpType, OpTime)",
				") ENGINE=MyISAM DEFAULT CHARSET=utf8;");		
			prepare stml from @v_Sql;
			EXECUTE stml;
			
			set v_CurTableName=v_NewTableName;			
		end;	
	end if;	

	SET @v_Sql = concat("select Max(ID) into @v_MaxID from ", v_CurTableName);
	prepare stml from @v_Sql;
	EXECUTE stml;	

	select v_CurTableName as CurTableName, @v_MaxID as MaxID;
	
commit;         

end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `sp_AddOpercordData`
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_AddOpercordData`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_AddOpercordData`(v_TableName varchar(20),v_Params varchar(10000))
    COMMENT '数据保存到GPS内存表2，待表里的数据行数到达5000条就调用1的存储过程，保存到内存表1，并转移2的数据'
begin

	declare v_sql varchar(11000);
	/*创建GPS小表1*/
	create  table if not exists tmp_oprecord(
		`ID` int(10) unsigned NOT NULL,
		`PlayerID` int(10) unsigned NOT NULL,
		`ModuleType` smallint(5) unsigned NOT NULL,
		`OpType` smallint(5) unsigned NOT NULL,
		`OpValue` int(10) unsigned NOT NULL,
		`OpTime` datetime NOT NULL,
		`AfterOpValue` bigint(20) unsigned NOT NULL,
		`Param1` bigint(20) unsigned NOT NULL,
		`Param2` bigint(20) unsigned NOT NULL,
		`Param3` bigint(20) unsigned NOT NULL,
		`Param4` bigint(20) unsigned NOT NULL,
		`PlayerLevel` smallint(5) unsigned NOT NULL,
		`VipLevel` smallint(6) NOT NULL,
		`Comment` varchar(128) NOT NULL DEFAULT '',
		PRIMARY KEY (`ID`),
		KEY `IX1` (`ModuleType`,`OpType`,`OpTime`),
		KEY `IX2` (`PlayerID`,`ModuleType`,`OpTime`),
		KEY `IX3` (`PlayerID`,`ModuleType`,`OpType`,`OpTime`))ENGINE=MEMORY DEFAULT CHARSET=utf8;


	set v_sql=concat('insert  into tmp_oprecord ',v_Params);##查询出来的数据放内存表中
	set @s=v_sql;
	prepare stmt from @s;
	execute stmt;


	/*返回表的行数*/
	select count(1)+1 Result from tmp_oprecord;
	#当超过 100000数据，默认全部保存到当

	if(Result > 100000) THEN
		BEGIN
			set v_sql=concat(' insert ignore into ', v_TableName,'  select * from tmp_oprecord');
			set @s=v_sql;
			prepare stmt from @s;
			execute stmt;
			truncate table tmp_oprecord;
		END;
	END IF;
	end
;;
DELIMITER ;

