-- Procedure structure for `sp_DelExpires`
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_DelExpires`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_DelExpires`()
    SQL SECURITY INVOKER
lable_1:
begin    
	declare done int default 0; 
	declare v_dbName varchar(255) default ''; 
	declare v_dbTable varchar(255) default ''; 
	declare cur1 cursor for select CurTableName  from moduletablename where CurTableName like 'oprecord_%';

	declare continue handler for sqlstate '02000' set done = 1;
	declare continue handler for sqlstate '23000' set done = 0;



	declare exit handler for sqlexception
	begin
			rollback;
	end; 

start transaction; 
		open cur1;
		repeat
			fetch cur1 into v_dbTable;
			if not done then
			begin
				#
				set @sqlstr = concat('DELETE from ',v_dbTable, ' where ModuleType not in(20, 21) and OpTime <  DATE_SUB(NOW(),INTERVAL 1 MONTH');
				select @sqlstr;
				prepare m_str from @sqlstr;
				execute m_str;
			end;
			end if;
		until done end repeat; 
		close cur1; 
commit;    
		select * from temp ORDER BY OpTime;
		DROP TABLE IF EXISTS `temp` ;
end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `sp_Resources`
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_Resources`;
DELIMITER ;;
CREATE DEFINER=`root`@`218.5.83.234` PROCEDURE `sp_Resources`(IN PlayerID int, IN ModuleType int, IN OpType int)
    SQL SECURITY INVOKER
lable_1:
begin    
	declare done int default 0; 
	declare v_dbName varchar(255) default ''; 
	declare v_dbTable varchar(255) default ''; 
	#declare cur1 cursor for select TABLE_SCHEMA,TABLE_NAME  from information_schema.TABLES where TABLE_SCHEMA = 'ios_app_s011_log' AND TABLE_NAME like 'oprecord_%';
	declare cur1 cursor for select CurTableName  from moduletablename where CurTableName like 'oprecord_%';

	declare continue handler for sqlstate '02000' set done = 1;
	declare continue handler for sqlstate '23000' set done = 0;



    declare exit handler for sqlexception
    begin
        rollback;
    end; 

	DROP TABLE IF EXISTS `temp`;
	CREATE TABLE `temp` (
		`ID` int(10) unsigned NOT NULL,
		`PlayerID` int(10) unsigned NOT NULL,
		`ModuleType` smallint(5) unsigned NOT NULL,
		`OpType` smallint(5) unsigned NOT NULL,
		`OpValue` int(10) unsigned NOT NULL,
		`OpTime` datetime NOT NULL,
		`AfterOpValue` bigint(20) unsigned NOT NULL,
		`Param1` bigint(20) unsigned NOT NULL,
		`Param2` bigint(20) unsigned NOT NULL,
		`Param3` bigint(20) unsigned NOT NULL,
		`Param4` bigint(20) unsigned NOT NULL,
		`PlayerLevel` smallint(5) unsigned NOT NULL,
		`VipLevel` smallint(6) NOT NULL,
		`Comment` varchar(128) NOT NULL DEFAULT '',
		PRIMARY KEY (`ID`),
		KEY `IX1` (`ModuleType`,`OpType`,`OpTime`),
		KEY `IX2` (`PlayerID`,`ModuleType`,`OpTime`),
		KEY `IX3` (`PlayerID`,`ModuleType`,`OpType`,`OpTime`)
	) ENGINE=MyISAM DEFAULT CHARSET=utf8;

start transaction; 
		open cur1;
		repeat
			fetch cur1 into v_dbTable;
			if not done then
			begin
				#
				IF(0 = OpType) THEN
					set @sqlstr = concat('insert into temp select * from ', v_dbTable, ' where PlayerID = ', PlayerID, ' and  (ModuleType = ', ModuleType, ' or ModuleType = ', ModuleType + 1, ')');
				ELSE
					set @sqlstr = concat('insert into temp select * from ', v_dbTable, ' where PlayerID = ', PlayerID, ' and  (ModuleType = ', ModuleType, ' or ModuleType = ', ModuleType + 1, ') and OpType =', OpType);
				END IF;
				#select @sqlstr;
				prepare m_str from @sqlstr;
				execute m_str;
			end;
			end if;
		until done end repeat; 
		close cur1; 
commit;    
		select * from temp ORDER BY OpTime;
		DROP TABLE IF EXISTS `temp` ;
end
;;
DELIMITER ;
